import './index.css';
import React from "react";

function TodoForm() {
   return (
      <form className="TodoForm">
         <label className='TodoFormTitle'>Crea un nuevo TODO</label>
         <input type="text" className="createTaskInput" placeholder="Crea un TODO" />
         <button className="btn createTaskButton">Crear</button>
         <button className="btn cancelTaskButton">Cancelar</button>
      </form>
   );
}

export { TodoForm };
